import React from 'react'
import styled from 'styled-components'
import antd from 'antd'
const { Input, Space, Button, Switch } = antd;
const Component = styled.div`
background: var(--secondprimary);
padding: 20px 40px;

p{
    margin: 0;
    font-size: 19px;
}
`
export default function Navigation() {
    const [toggleActiveMode, settActiveMode] = React.useState(false)
    return (
        <Component>
            <p>
                Navigation
            </p>

            <Switch
                checked={toggleActiveMode}
                checkedChildren="Input"
                unCheckedChildren="TextArea"
                onChange={() => {
                    settActiveMode(!toggleActiveMode);
                }}
            />
        </Component>
    )
}
